import React from 'react';

export default class SocialCard extends React.Component{
    render(){
        const {title, image:img, content_text:text} = this.props;
        return (
            <article className='card text-white text-center bg-dark mb-3' style={{maxWidth: "18rem"}}>
                <img src={img} className='card-img-top' alt="Not Found" />
                <div className='card-body'>
                    <h3 className='card-title'>{title}</h3>
                    <span className='card-text'>{text}</span>
                </div>
                
            </article>
        )
    }
}
